script: |
  super -f text -I q1023.spq | sort > q1023.out

inputs:
  - name: q1023.spq
    data: |
      SELECT DISTINCT col0 / - col1 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT 88 + 79 * ( - 21 + - col1 ) IN ( + col2 );
  - name: tab1

outputs:
  - name: q1023.out
    data: |
      -1
      -17
      -3
